import './assets/styles/custom.scss';
import './App.css';
import Header from 'components/Header';
import Div1 from 'components/Div1';
import Div2 from 'components/Div2';
import Footer from 'components/Footer';

function App() {
  return (
    <>
       <Header/>
       <Div1/>
       <Div2/>
       <Footer/>
    </>
  );
}

export default App;
